import { Route, Switch, Redirect } from "react-router-dom";
import BillsPage from "./pages/BillsPage";
import Layout from "../src/components/Layout/Layout";
import HomePage from "./pages/HomePage";
import { useContext } from "react";
import AuthContext from "./store/auth-context";
import LoginPage from "./pages/Auth/LoginPage";
import AdminsPage from "./pages/Auth/AdminsPage";
import {useSelector} from 'react-redux';

function App() {
  const authCtx = useContext(AuthContext);
  const admin=useSelector(state=>state.ui.adminsPage)
  //const [admin,setIsAdmin]=useState(false);
  console.log(admin)

  // async function GetUserByCredentials(credentials){
  // const credentials=JSON.stringify(userCredsObj);
  // const getUserResponse = await fetch('https://localhost:7269/api/User/GetUserByCredentials', {
  //     method: 'POST',
  //     body: credentials,
  //     headers: {
  //       'Content-Type': 'application/json'
  //     }
  //   });
  //   const getUserData = await getUserResponse.json();
  //   if(getUserData.role === 'admin'){
  //     setIsAdmin(true)
  //   }


  return (
    <Layout>
        {!authCtx.isLoggedIn && 
        <Switch>
          <Route path="/auth">
            <LoginPage />
          </Route>
          <Route path="*">
          <Redirect to="/auth" />
          </Route>          
        </Switch>
        }
        {admin && authCtx.isLoggedIn &&
        <Switch>
              <Route path='/admin' exact>
                  <AdminsPage/>   
              </Route>      

              <Route path="*">
                  <Redirect to="/admin" />
               </Route>          
        </Switch>
        }
        {!admin && authCtx.isLoggedIn &&
        <Switch>
          <Route path="/homepage" exact>
          <HomePage />
         </Route>
          <Route path="/billslist" exact>
          <BillsPage />
          </Route>
          <Route path="*">
                  <Redirect to="/homepage" />
               </Route> 
        </Switch>
        }
    </Layout>
  );
}

export default App;
